// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CadastroForm from './components/CadastroForm';
import UserList from './components/UserList';
import EditUser from './components/EditUser';
import CadastroProduto from './components/CadastroProduto'; // Importando o novo componente
import ListaProduto from './components/ListaProduto'; // Componente para listar produtos

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<CadastroForm />} />
                <Route path="/usuarios" element={<UserList />} />
                <Route path="/editar/:id" element={<EditUser />} />
                <Route path="/cadastrar-produto" element={<CadastroProduto />} /> {/* Rota para cadastrar produtos */}
                <Route path="/produtos" element={<ListaProduto />} /> {/* Rota para listar produtos */}
            </Routes>
        </Router>
    );
};

export default App;
